import './App.css';
import SignInView from './components/SignInView/SignInView';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter} from 'react-router-dom'
function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <SignInView/>
    </div>
    </BrowserRouter>
  );
}

export default App;
